import sys

def PatternMatch(pattern, genome):
	count = 0
	end = len(genome) - len(pattern)
	positions = []
	for i in range(end+1):
		#checks if window contains pattern and if so increments occurrances 
		if genome[i:len(pattern)+i] == pattern: 
			positions.append(i)
			
	print(" ".join(str(x) for x in positions))

#PatternMatch(pattern2,text2)

file = open(sys.argv[1], 'r')
pat = file.readline()
text = file.readline() 

PatternMatch(str(pat),str(text))
